export default function Loginpage(){
  return(
    <div>
      <form className="login">
        <h1>Login </h1>
        <input type="text" placeholder="username"/>
        <input type="password" placeholder="password"/>
        <button type="Login">Login</button>

      </form>
    </div>
  )
}
